import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
const user = {
    name: "Hoang",
    email: "haha@gmail.com"
};
const element = <h1>Hello my name is {user.name}, my email is {user.email}</h1>;

ReactDOM.render(element, document.getElementById('root'));

